import React from "react";
import FriendListItem from "./FriendListItem";
import styles from './FriendList.css'

const FriendList=({friends})=> {
  return(  <ul className={styles.friendsList}>
         {friends.map(friend => (
             <FriendListItem
                 key = {friend.id}
                 {...friend}/>))}
     </ul>
 )
 }

export default FriendList;
